import React from 'react'
import ProductCard from './ProductCard'

const PRODUCTS = [
  {
    id: 'espresso',
    name: 'Espresso',
    price: 2.5,
    tags: ['Hot'],
    img: 'https://images.unsplash.com/photo-1511920170033-f8396924c348?w=800&q=60',
  },
  {
    id: 'latte',
    name: 'Café Latte',
    price: 3.5,
    tags: ['Hot', 'Milk'],
    img: 'https://images.unsplash.com/photo-1541167760496-1628856ab772?w=800&q=60',
  },
  {
    id: 'cappuccino',
    name: 'Cappuccino',
    price: 3.8,
    tags: ['Hot'],
    img: 'https://images.unsplash.com/photo-1505250469679-203ad9ced0cb?w=800&q=60',
  },
  {
    id: 'coldbrew',
    name: 'Cold Brew',
    price: 4.0,
    tags: ['Iced'],
    img: 'https://images.unsplash.com/photo-1542444459-db1b2f20ea3d?w=800&q=60',
  },
  {
    id: 'flatwhite',
    name: 'Flat White',
    price: 3.7,
    tags: ['Hot'],
    img: 'https://images.unsplash.com/photo-1512341689857-198e7e2f3ee3?w=800&q=60',
  },
  {
    id: 'mocha',
    name: 'Mocha',
    price: 4.2,
    tags: ['Chocolate'],
    img: 'https://images.unsplash.com/photo-1498804103079-a6351b050096?w=800&q=60',
  },
]

export default function MenuGrid() {
  return (
    <div
      id="menu"
      className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6"
    >
      {PRODUCTS.map((p) => (
        <ProductCard key={p.id} product={p} />
      ))}
    </div>
  )
}
